    {
        /// <summary>
        /// Converts a <see cref="CallRecord"/> to a collection of <see cref="IKustoCallRecord"/> using the provided <see cref="IJsonProcessor"/>.
        /// </summary>
        /// <param name="callRecord"></param>
        /// <param name="flattener"></param>
        /// <param name="tenantIdContext"></param>
        /// <returns></returns>
        public static IEnumerable<IKustoCallRecord> AsKustoCallRecords(this CallRecord callRecord, IJsonProcessor flattener, string tenantIdContext)
        {
            var flattenerResults = flattener.ProcessNode(callRecord.SerializeAsString());
            if (flattenerResults?.Any() != true)
                return Enumerable.Empty<IKustoCallRecord>();

            var results = new List<IKustoCallRecord>();
            foreach (var flattenedResult in flattenerResults)
            {
                var kustoCallRecord = FromJsonDictionary(flattenedResult);
                kustoCallRecord.CallRecordTenantIdContext = tenantIdContext;
                results.Add(kustoCallRecord);
            }
            return results;
        }

